import { render } from "@testing-library/react";
import React, { Component } from "react";
import "./Profile.css";
var wow = false;
const users = new Map();
users.set("test", "password");
var profileName = "Jazmine"; 
function createAccount() {
  //Need to check if userName has already been created

  const userName = document.getElementById("newuser-name").value;
  const password = document.getElementById("newuser-pass").value;
  if (users.has(userName)) console.log("Username already taken!");//Action maybe
  else users.set(userName, password);
  profileName = userName;
  console.log(users.entries());
  wow = true;
}

function checkAccount() {
  var userName = document.getElementById("user-name").value;
  var password = document.getElementById("user-pass").value;
  if (users.get(userName) === password) console.log("Here!"); //log in
  else console.log("Not here");//Action maybe
  profileName = userName;
  wow = true;

}
class Account extends Component{
  render(){
    return (
      <h1>
        Hello Account Owner!
      </h1>
    );
  }
}
function Trial(props){
  const isLoggedIn = props.isLoggedIn;
      if(wow)
        <Account/>
      else
        <LogIn/>

}

class LogIn extends Component{
  render(){
    return (
      <React.Fragment>
        <div class="split left">
          <div class="centered">
            <h1>Welcome !</h1>
            <h3>Already have an account ?</h3>
            <input
              type="text"
              id="user-name"
              class="input-box"
              placeholder="User Name"
            ></input>
            <br></br>
            <br></br>
            <input
              type="password"
              id="user-pass"
              class="input-box"
              placeholder="Password"
            ></input>
            <br></br>
            <br></br>
            <button id="loginButton" onClick={checkAccount}>
              Log in!
            </button>
          </div>
        </div>

        <div class="split right">
          <div class="centered">
            <h1>Welcome !</h1>
            <h3>No Account? Sign up!</h3>
            <input
              type="text"
              id="newuser-name"
              class="input-box"
              placeholder="User Name"
            ></input>
            <br></br>
            <br></br>
            <input
              type="password"
              id="newuser-pass"
              class="input-box"
              placeholder="Password"
            ></input>
            <br></br>
            <br></br>
            <button id="signupButton" onClick={createAccount}>
              {" "}
              Sign Up
            </button>
          </div>
        </div>
      </React.Fragment>
    );
  }
}

export default ProfilePage;
function ProfilePage() {
  render(
    <Trial isLoggedIn = {false} />
  )
}
